	"ClickToCollapse" : "Klik for at skjule",
	"ClickToExpand" : "Klik for at udvide",
	"ContactUslink" : " Hvis du har yderligere spørgsmål, så \u003ca href=\"@MYCHART@ABSOLUTEURL@inside.asp?mode=custsvc\"\u003ekontakt os.\u003c/a\u003e ",
	"CurrentlySharingHeader" : "Din patientjournal kan deles, hvis du modtager pleje et andet sted.",
	"DetailSectionHeader" : "Hvordan fungerer det, når min journal deles?",
	"DownloadMyRecordAltText" : "Download min patientjournal",
	"ErrorPopupOKButton" : "OK",
