	"FooterTextSharing" : "Der kan anmodes om din patientjournal af læger ved andre sundhedsorganisationer, hvis du har brug for behandling eller pleje et andet sted.\u003ca class=\"linkcolorOverride\" href=\"@MYCHART@ABSOLUTEURL@CareEverywhere\"\u003eLæs mere.\u003c/a\u003e",
	"NotCurrentlySharingHeader" : "Du har valgt ikke at dele din patientjournal med andre sundhedsorganisationer.",
	"NotSharingImageAltText" : "Deler ikke",
	"NotSharingWarning" : "Klinikere uden for denne organisation vil ikke være i stand til elektronisk at anmode om vigtige oplysninger vedrørende din pleje vha. Care Everywhere.",
	"OnlyPhysiciansDisclaimer" : "Klinikere kan kun anmode om din patientjournal, hvis de har en gyldig grund til at gøre det.",
	"OptOutNoLink" : "Du kan vælge at begrænse deling af dine sundhedsoplysninger til dit plejepersonale hos denne organisation.",
	"OptOutWithLink" : " Du kan vælge \u003ca href=\"#\" id=\"OptOutLink\"\u003eat begrænse deling\u003c/a\u003e af dine sundhedsoplysninger til dit plejepersonale hos denne organisation. ",
	"posttext" : "",
	"pretext" : "",
	"RecordSharingFAQText" : "\r\n\t\t\t\t\u003cdt\u003eDit helbred er vores prioritet\u003c/dt\u003e\r\n\t\t\t\t\u003cdd\u003e\r\n\t\t\t\t\tVi ønsker at hjælpe dig med at få sikker og effektiv pleje i vores organisation og andre steder, hvor du modtager behandling. \r\n\t\t\t\t\tVi kan dele din journal med andre sundhedsorganisationer uden for denne organisation og din sundhedsplan, så dine oplysninger er tilgængelige for dit sundhedsfaglige team. \r\n\t\t\t\t\tFor eksempel kan vi dele din journal, så dine læger har adgang til din helbredshistorik i nødsituationer, eller så en specialist du blev henvist til, har et klart billede af din helbredsplan. \r\n\t\t\t\t\u003c/dd\u003e\r\n\r\n\t\t\t\t\u003cdd\u003e\r\n\t\t\t\t\tVi bruger et værktøj, der hedder Care Everywhere, som gør det muligt for sundhedspersonale hos andre organisationer at anmode om og udveksle vigtige oplysninger for din pleje. Sikker elektronisk udveksling af din journal giver dit sundhedsfaglige team de oplysninger, de har brug for til at træffe velinformerede beslutninger om din pleje og kan endda hjælpe med at forhindre fejl eller hjælpe dig med at undgå unødvendige tests eller procedurer.\r\n\t\t\t\t\t Elektronisk udveksling af din journal kan også hjælpe med at forbedre din oplevelse ved at reducere mængden af din medicinske historik og journal, som du skal huske, bringe med dig eller have sendt til dit sundhedspersonale. \r\n\t\t\t\t\u003c/dd\u003e\r\n\r\n\r\n\t\t\t\t\u003cdt\u003eHvem kan anmode om mine oplysninger? \u003c/dt\u003e\r\n\t\t\t\t\u003cdd\u003e\r\n\t\t\t\tSundhedsorganisationer, der identificerer dig som en af deres patienter, kan anmode om din journal fra vores organisation. \r\n\t\t\t\tDette hjælper medlemmer af dit sundhedsfaglige team, med at koordinere de forskellige aspekter af din pleje.\r\n\t\t\t\t\u003c/dd\u003e\r\n\t\t\t\t\r\n\t\t\t\t\u003cdt\u003eHvilke oplysninger deles?\u003c/dt\u003e\r\n\t\t\t\t\u003cdd\u003e\r\n\t\t\t\t\t\u003cp\u003eOplysninger i din elektroniske helbredsjournal kan deles med henblik på behandling, herunder:\u003c/p\u003e\r\n\r\n\t\t\t\t\t\u003cul style=\"padding-left:20px; list-style-type:disc\"\u003e\r\n\t\t\t\t\t\t\u003cli\u003eAllergier\u003c/li\u003e\r\n\t\t\t\t\t\t\u003cli\u003eVaccinationer\u003c/li\u003e\r\n\t\t\t\t\t\t\u003cli\u003eLægemidler\u003c/li\u003e\r\n\t\t\t\t\t\t\u003cli\u003eMedicinsk historik, kirurgisk historik, familiære dispositioner og livsstilsfaktorer\u003c/li\u003e\r\n\t\t\t\t\t\t\u003cli\u003e Klinik- og hospitalsbesøg \u003c/li\u003e\r\n\t\t\t\t\t\t\u003cli\u003eTestresultater \u003c/li\u003e\r\n\t\t\t\t\t\t\u003cli\u003eDiagnoser\u003c/li\u003e\r\n\t\t\t\t\t\t\u003cli\u003e Procedurer \u003c/li\u003e\r\n\t\t\t\t\t\u003c/ul\u003e\r\n\t\t\t\t\u003c/dd\u003e\r\n\r\n\t\t\t\t\r\n\r\n\t\t\t\t\u003cdt\u003eHvordan beskyttes mine oplysninger? \u003c/dt\u003e\r\n\t\t\t\t\u003cdd\u003e\r\n\t\t\t\tVi beskytter omhyggeligt privatlivets fred og sikkerhed for dine oplysninger ved hjælp af forskellige fysiske, administrative og tekniske kontroller. \r\n\t\t\t\tNår vi deler dine sundhedsoplysninger med autoriserede anmoder, bliver din journal krypteret og leveret i et sikkert, elektronisk format.\r\n                \u003c/dd\u003e\r\n\t\t\t\t",
